import Navbar from './components/Navbar'
import Register from './pages/Register'
import Reservation from './pages/Reservation'

function App() {
  let component
  switch(window.location.pathname){
    case '/':
      component = <App />
      break
    case '/Register':
      component = <Register />
      break
    case '/Reservation':
      component = <Reservation />
      break
  }

  return (
    <div className="App">
      <Navbar />
      {component}
    </div>
  );
}

export default App;
